import React, { useEffect } from "react";
import { Row } from "react-bootstrap";
import Navigation from "../Component/Navigation";
import Footer from "./Footer"

const Blog =() => {

    useEffect(() => {
        fetch("" , {method: "GET"}).then((result) =>{
            result.json().then((res) =>{
             console.log(res)   
            })
        })
    })
    return(
        <>
        <Row><Navigation /></Row>
        <div className="mt-5">

        </div>
        <Footer />
        </>
    )
}
export default Blog
